	(108, '2024-02-21 13:38:38', '2024-02-23 01:54:56', 35, 12, 5, NULL, NULL, '2024-02-22 20:00:00', NULL, '2024-02-22 20:03:51', '2024-02-22 21:14:07', 'CONDUCTED', 'Identify the feeling of characters in the story', 'https://us06web.zoom.us/j/2318232507?pwd=ckx2MEhVNG9GQnlkNWJmMm1KZEIvZz09&omn=86061916338', '<p>was/were+ adjective</p>\n<p>felt + adjective</p>\n<p>became + adjective</p>', NULL, NULL, '"[]"', '"[]"', NULL, NULL, 'Meeting-00108', 60, 0, 60000, NULL),
	(109, '2024-02-22 08:14:35', '2024-02-23 01:57:16', 40, 14, 2, NULL, NULL, '2024-02-22 14:00:00', NULL, '2024-02-22 16:29:00', '2024-02-22 16:29:24', 'CONDUCTED', 'Sistem Persamaan Linier Dua Variabel (SPLDV)', 'https://us06web.zoom.us/j/2318232507?pwd=ckx2MEhVNG9GQnlkNWJmMm1KZEIvZz09&omn=86061916338', '<ul>\n<li>Persamaan Linier Satu Variabel</li>\n<li>Persamaan Linier Dua Variabel</li>\n<li>Sistem Persamaan Linier Dua Variabel</li>\n<li>Latihan Soal SPLDV</li>\n</ul>', 'Tetap semangat belajarnya! Semoga semakin paham dengan materi yang kita review ulang hari ini.', 'Konfirmasi terlalu mepet dengan jadwal les sehingga entri setelah kelas selesai. Kelas hari ini berdurasi 70 menit.', '"[]"', '"[]"', NULL, NULL, 'Meeting-00109', 75, 0, 60000, NULL),
	(110, '2024-02-22 08:15:18', '2024-02-23 01:56:31', 50, 14, 2, NULL, NULL, '2024-02-22 16:30:00', NULL, '2024-02-22 16:34:17', '2024-02-22 18:18:30', 'CONDUCTED', 'Bangun Ruang Sisi Lengkung', 'https://us06web.zoom.us/j/2318232507?pwd=ckx2MEhVNG9GQnlkNWJmMm1KZEIvZz09&omn=86061916338', '<ul>\n<li>Jenis-jenis bangung ruang sisi lengkung</li>\n<li>Volume tabung + latihan soal</li>\n<li>Luas permukaan tabung + latihan soal</li>\n<li>Volume kerucut + latihan soal</li>\n<li>Luas selimut kerucut</li>\n<li>Luas permukaan kerucut</li>\n</ul>', 'Terima kasih telah belajar dengan serius dan disiplin. Semoga hasil belajarnya bisa lebih baik secara bertahap. Tetap semangat, Joanna!', 'Kelas hari ini berdurasi 94 menit (berdasarkan video rekaman Zoom)', '"[]"', '"[]"', NULL, NULL, 'Meeting-00110', 90, 0, 60000, NULL),
	(111, '2024-02-23 16:43:06', '2024-02-27 01:48:45', 33, 11, 14, NULL, NULL, '2024-02-24 13:00:00', '2024-02-24 13:01:42', '2024-02-24 12:59:54', '2024-02-24 15:20:30', 'CONDUCTED', 'describe a person ', 'https://us06web.zoom.us/j/2318232507?pwd=ckx2MEhVNG9GQnlkNWJmMm1KZEIvZz09&omn=86061916338', NULL, NULL, 'Kelas dimulai: 13.00\nkelas selesai: 14.04\n', '"[]"', '"[]"', NULL, NULL, NULL, 60, 0, 85000, NULL),
	(112, '2024-02-24 00:35:55', '2024-02-27 01:47:21', 42, 15, 14, NULL, NULL, '2024-02-24 10:00:00', NULL, '2024-02-24 11:03:14', '2024-02-24 11:06:22', 'CONDUCTED', 'General Discussion', 'https://us06web.zoom.us/j/2318232507?pwd=ckx2MEhVNG9GQnlkNWJmMm1KZEIvZz09&omn=86061916338', '<p>Practicing sharing opinions on topics related to places and and learning.&nbsp;</p>', NULL, 'Our topic for today\'s tutoring is about expressing opinions. Kak Gloria has shown remarkable improvements in explaining her answers. She knows what to say, how to say it, and how to add more information to make her opinions more reliable. She just needs a bit more practice on some grammar usage. Other than that, she is continuously improving.', '"[]"', '"[]"', 'https://drive.google.com/file/d/1r92EgKAxRFEr6lbIdtG_M2Kn20gtyKi1/view?usp=drive_link ', NULL, 'Meeting-00112', 60, 0, 85000, NULL),
	(113, '2024-02-24 00:36:20', '2024-02-27 01:48:24', 43, 15, 14, NULL, NULL, '2024-02-24 12:00:00', NULL, NULL, NULL, 'CANCELLED', 'Preparation for Assessment Test', 'https://us06web.zoom.us/j/2318232507?pwd=ckx2MEhVNG9GQnlkNWJmMm1KZEIvZz09&omn=86061916338', '<p>Practicing brainstorming and writing report text based on topics:&nbsp;</p>\n<ul>\n<li>The Importance of Mental Health</li>\n<li>Things to do during Holidays</li>\n<li>Stress Management</li>\n</ul>\n<p>&nbsp;</p>', NULL, NULL, '"[]"', '"[]"', NULL, NULL, NULL, 60, 0, 85000, NULL),
	(114, '2024-02-24 00:36:53', '2024-02-27 01:51:13', 43, 15, 14, NULL, NULL, '2024-02-25 10:00:00', NULL, '2024-02-25 10:28:46', '2024-02-25 11:37:31', 'CONDUCTED', 'Preparation for Assessment Test', 'https://us06web.zoom.us/j/2318232507?pwd=ckx2MEhVNG9GQnlkNWJmMm1KZEIvZz09&omn=86061916338', '<p>Outlining Assessment Test in March with topic "Several Ways to Make an Exciting and Interesting Teaching and Learning Process".&nbsp;</p>', NULL, '-Class starts at 10.30 - 11.30.\n-Kak Della outlines her topic. \n-For the description, she only made 1 point. However, we discussed together more points to add up to her outline. ', '"[]"', '"[]"', 'https://drive.google.com/file/d/1WnDv0P8h9BvdgAATsiqLuqLd5jekN0AW/view?usp=drive_link', NULL, NULL, 60, 0, 85000, NULL),
	(115, '2024-02-25 06:12:04', '2024-02-27 01:51:32', 40, 14, 2, NULL, NULL, '2024-02-25 14:00:00', NULL, '2024-02-25 14:00:48', '2024-02-25 15:04:05', 'CONDUCTED', 'Persamaan Linier Dua Variabel (PLDV)', 'https://us06web.zoom.us/j/2318232507?pwd=ckx2MEhVNG9GQnlkNWJmMm1KZEIvZz09&omn=86061916338', '<ul>\n<li>Menentukan KPK dari 2 bilangan yang berbeda</li>\n<li>Bentuk penyelesaian dari PLDV</li>\n<li>Menentukan penyelesaian dari PLDV</li>\n</ul>', 'Terima kasih sudah hadir di pertemuan hari ini. Meskipun tidak banyak yang kita pelajari hari ini, semoga ilmu yang sedikit tersebut bisa bermanfaat di kemudian hari. Tetap semangat, Chris!', 'Kelas hari ini berlangsung sekitar 60 menit.', '"[]"', '"[]"', NULL, NULL, NULL, 60, 0, 60000, NULL),
